import React from "react";
import "./App.css";

const Kombatants = () => {
    return (
        <>
            <div className="row">
                <div className="col-8"></div>
                <div
                    className="col-4"
                    id="latestVersion"
                    // style={"font-family: Bronzier, Arial, sans-serif"}
                >
                    <p>The latest version is: v6</p>
                </div>
                <h1>KOMBATANTS</h1>
            </div>
        </>
    );
};
export default Kombatants;
